(30, 'Cắt Và Gội ( 30 - 60K )', 'data:image/jpeg;base64,', '<h1>Dịch Vụ Cắt Và Gội Đầu</h1>\n<h3>Gồm 5 bước :</h3>\n<ol>\n<li>Xã và gội tóc trước khi cắt</li>\n<li>Mát xa đầu và giảm stress</li>\n<li>Sấy khô tóc</li>\n<li>Tư vấn kiểu tóc ( theo mẫu hoặc từ sự tư vấn của thợ )</li>\n<li>Cạo mặt miễn phí</li>\n</ol>\n<p><img src=\"https://user-images.githubusercontent.com/106864964/201602086-b1533d38-fee5-4302-93e8-3d1195ddd98a.jpeg\" alt=\"top-15-dau-goi-dau-danh-cho-nam-gioi-tot-nhat-hien-nay\"></p>', '\n# Dịch Vụ Cắt Và Gội Đầu \n\n### Gồm 5 bước :\n\n\n1. Xã và gội tóc trước khi cắt\n2. Mát xa đầu và giảm stress \n3. Sấy khô tóc\n4. Tư vấn kiểu tóc ( theo mẫu hoặc từ sự tư vấn của thợ )\n5. Cạo mặt miễn phí\n\n![top-15-dau-goi-dau-danh-cho-nam-gioi-tot-nhat-hien-nay](https://user-images.githubusercontent.com/106864964/201602086-b1533d38-fee5-4302-93e8-3d1195ddd98a.jpeg)\n\n', '2022-11-14 14:40:00', '2022-11-16 21:47:43');
